import React, { Component } from 'react'

class Form extends Component {

    constructor(props){
        super(props)

        this.state = {
            searchField: ''
        }
    }

    render(){
        return (
            <form>
                <input type='text' value={this.state.searchField}/>
            </form>
        )
    }
}

export default Form
